import React from 'react';
import Header from '../components/Header/Header';
import Footer from '../components/Footer/Footer';
import DateDisplay from '../components/DateDisplay';
import { Helmet } from 'react-helmet';
import '../components/HomePage/_homepage.sass';

const HomePage: React.FC = () => {
    return (
        <div className="container">
            <Helmet>
                <title>Home</title>
            </Helmet>
            <Header title="Welcome" />
            <DateDisplay />
            <div className="content">
                <HeroSection />
                <ServicesSection />
            </div>
            <Footer />
            </div>
    );
};

const HeroSection: React.FC = () => (
    <section className="hero">
        <h1>Welcome to My Portfolio</h1>
        <p>Explore my work and projects</p>
        <button className="ca-button">Get Started</button>
    </section>
);


const ServicesSection: React.FC = () => (
    <section className="services">
        <h2>My Services</h2>
        <div className="services-container">
            <div className="service-card">
                <h3>Web Development</h3>
                <p>Building responsive web applications...</p>
            </div>
            <div className="service-card">
                <h3>Mobile Development</h3>
                <p>Creating mobile applications for Android and iOS...</p>
            </div>
            <div className="service-card">
                <h3>UI/UX Design</h3>
                <p>Designing user-friendly and aesthetic interfaces...</p>
            </div>
        </div>
    </section>
);

const ContactSection: React.FC = () => (
    <section className="contact">
        <h2>Contact Me</h2>
        <form className="contact-form">
            <input type="text" placeholder="Your Name" required />
            <input type="email" placeholder="Your Email" required />
            <textarea placeholder="Your Message" required></textarea>
            <button type="submit">Send Message</button>
        </form>
    </section>
);

export default HomePage;
